import React from 'react';
import { Link } from 'react-router-dom';

const Plants: React.FC = () => {
  // Mock plant data
  const plants = [
    { id: 1, name: 'Monstera Deliciosa', type: 'Indoor' },
    { id: 2, name: 'Snake Plant', type: 'Indoor' },
    { id: 3, name: 'Fiddle Leaf Fig', type: 'Indoor' },
    { id: 4, name: 'Aloe Vera', type: 'Succulent' },
    { id: 5, name: 'Lavender', type: 'Outdoor' },
    { id: 6, name: 'Rosemary', type: 'Herb' }
  ];

  return (
    <div className="plants-page">
      <h1>Plants Collection</h1>
      <div className="plants-grid">
        {plants.map(plant => (
          <Link to={`/plants/${plant.id}`} key={plant.id} className="plant-card card">
            <h2>{plant.name}</h2>
            <p>Type: {plant.type}</p>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default Plants;
